function drawGraph(links,nodes,freq) {

var width = 400,
    height = 400,
    color = d3.scale.category20c();

console.log(nodes);
console.log(links);

var force = d3.layout.force()
    .nodes(d3.values(nodes))
    .links(links)
    .size([width, height])
    .linkDistance(300)
    .charge(-2500)
    .on("tick", tick)
    .start();

// Set the range
var  v = d3.scale.linear().range([0, 100]);

// Scale the range of the data
v.domain([0, d3.max(links, function(d) { return d.value; })]);


var svg = d3.select("#graph").append("svg")
    .attr("width", "100%")
    .attr("height", "100%")
    .attr("viewBox","0 0 1200 1200");

// build the arrow.
svg.append("svg:defs").selectAll("marker")
    .data(["end"])      // Different link/path types can be defined here
  .enter().append("svg:marker")    // This section adds in the arrows
    .attr("id", String)
    .attr("viewBox", "0 -5 10 10")
    .attr("refX", 15)
    .attr("refY", -1.5)
    .attr("markerWidth", 6)
    .attr("markerHeight", 6)
    .attr("orient", "auto")
  .append("svg:path")
    .attr("d", "M0,-5L10,0L0,5");

// add the links and the arrows
var path = svg.append("svg:g").selectAll("path")
    .data(force.links())
  .enter().append("svg:path")
    .attr("class", function(d) { return "link " + d.source.name.replace(" ", "-") + " " + d.target.name.replace(" ", "-"); })

// coloring links
    .style("stroke","#2196f36b")
    .style("fill","none")
    .style("stroke-width", function(d) {return Math.log(d.value-20)*Math.log(d.value-20)/2;});
// define the nodes
var x;
var node = svg.selectAll(".node")
    .data(force.nodes())
  .enter().append("g")
    .attr("class", "node")
    .attr("id",function(d){return d.name.split(' ').join('-');})
    .attr("value", function (d) { return d.name.replace(" ", "-");})
    // pinnning nodes
    .on("dblclick", function doubleclick(d){
      if (d.fixed==false) {
        d3.select(this).classed("fixed",d.fixed=true);
        d3.select(this).select("circle").classed("fixed-circle",true);
        d3.selectAll('.'+this.__data__.name.replace(" ", "-")).style("stroke","#ff5722ba");
      }
      else {
        d3.select(this).classed("fixed",d.fixed=false);
        d3.select(this).select("circle").classed("fixed-circle",false);
        d3.selectAll('.'+this.__data__.name.replace(" ", "-")).style("stroke","#2196f36b");
      }
    })
    .call(force.drag);

// add the nodes
// scaling node sizes
node.append("circle")
    .attr("id", function(d){return "c-"+d.name.split(' ').join('-');})
    .attr("r", function(d){return Math.log(freq[d.name])});

// add the node label
var label = node.append("text")
                .attr("id", function(d){return "t-"+d.name.split(' ').join('-');})
                .attr("x", 15)
                .attr("y",4)
                .text(function(d) {return d.name;});

// add the curvy lines
function tick() {
    path.attr("d", function(d) {
        var dx = d.target.x - d.source.x,
            dy = d.target.y - d.source.y,
            dr = Math.sqrt(dx * dx + dy * dy);
        return "M" +
            d.source.x + "," +
            d.source.y + "A" +
            dr + "," + dr + " 0 0,1 " +
            d.target.x + "," +
            d.target.y;
    });

    node
        .attr("transform", function(d) {
            return "translate(" + d.x + "," + d.y + ")"; });
};

for (var i = 0; i < source_essence.length; i++) {
    var e = source_essence[i];
    d3.select("#c-"+e.split(' ').join('-')).style("fill","red")
    //d3.select("#t-"+e.split(' ').join('-')).attr("x",(-20-e.length)).style("color","white").style("font-size","20")
}

return svg;
}


